	// <Route {...rest} render={(props)=>(
	// 	( auth.logged && (level === '0') )
	// 	?<Component {...props} />
	// 	:<Redirect to={"/"+loginPage} />
	// )} />
	<Route {...rest} render={props=>{
		return <Component {...props} />
	}} />
)

const mapStateToProps = state => ({
	auth: state.auth
})

export default connect(mapStateToProps)(PrivateRoute);
